import Cards from './components/Cards/Cards.jsx';
import Footer from './components/Footer/Footer.jsx';
import Nav from './components/Nav/Nav';

function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getRecipes())
    dispatch(getDiets())

  }, [dispatch])

  return (
    <div className="App">
      <Nav/>
      <Cards/>
      <Footer/>
    </div>
  );
}

export default App;
